import Header from "./Header";
import React from "react";

const layoutStyle = {
    margin: 20,
    padding: 20,
    border: '1px solid #DDD'
};

type Props = {}

const Layout: React.FunctionComponent<Props> = ({children}) => (
    <div style={layoutStyle}>
        <Header />
        {children}
    </div>
);

export default Layout;
